const useStyles = makeStyles((theme) => ({
  root: {
    textAlign: 'center'
  },
}));

export default function About() {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <MainBar />
      <Typography>About ThirdsMedia</Typography>
    </div>
  );
}
